import React from 'react';



class ProductList extends React.Component {
  // constructor(props) {
  //   super(props);
  //   this.state = this.props.products;
  // }


  render() {
    const { products } = this.props.products;
    return (
      <ul>
        {products.map((product) => (
          <li key={product.key}>
            <p>{product.id}</p>
            <p>{product.title}</p>
            <p>{product.price}</p>
          </li>
        ))}
      </ul>
    );
  }
}

export default ProductList;
